import SectionContact from '../../component/SectionContact/SectionContact';
import './contact.css';

const Contact = () => {
  return (
    <div>
      <h1>Contact</h1>
      <SectionContact />
      <SectionContact />
      <SectionContact />
      <SectionContact />
    </div>
  );
};

export default Contact;
